import { Component } from '@angular/core';

@Component({
  selector: 'app-photos',
  templateUrl: './photos.component.html',
  styleUrls: ['./photos.component.css']
})
export class PhotosComponent {
  generalPhotos: string[] = [
    './../../../assets/general/general_1.jpg',
    './../../../assets/general/general_2.jpg',
    './../../../assets/general/general_3.jpg',
    './../../../assets/general/general_4.jpg',
    './../../../assets/general/general_5.jpg',
    './../../../assets/general/general_6.jpg',
  ];

  naturePhotos: string[] = [
    'assets/photos/nature/folder_1.jpg',
    'assets/photos/nature/folder_2.jpg',
    'assets/photos/nature/folder_3.jpg',
    // add more photo file paths as needed
  ];

  valleyPhotos: string[] = [
    'assets/photos/valley/folder_1.jpg',
    'assets/photos/valley/folder_2.jpg',
    'assets/photos/valley/folder_3.jpg',
    // add more photo file paths as needed
  ];
}
<div class="flex flex-row justify-around mx-10 my-5">
  <button type="button" class="photos-button">General</button>
  <button type="button" class="photos-button">Nature</button>
  <button type="button" class="photos-button">Valley</button>
</div>
<app-slides></app-slides>
